import React, { useState } from "react";
import "../../App.css";

export default function Login() {
  const [username, setUserName] = useState();
  const [password, setPassword] = useState();
  return (
    <section className="vh-100 login-style">
      <form>
        <label>
          <p>Username</p>
          <input type="text" />
        </label>
        <label>
          <p>Password</p>
          <input type="password" />
        </label>
        <div>
          <button type="submit">Submit</button>
        </div>
      </form>
    </section>
  );
}
